import React, {useState} from "react";
import "../mainpage.scss"


const ThanksStep = (step, steps, setStep) => {
    function NextStep() {
        setStep((step += 1));
    }
    function StepBack() {
        setStep((step -= 1));
    }
    return (
        <>
            <div className="thanks-wrapper">

            </div>
        </>
    )
}

export default ThanksStep
